// src/components/FAQ/FAQ.js
import React from 'react';

const FAQ = () => {
  return (
    <section className="p-8 bg-gray-100 text-center">
      <h3 className="text-2xl font-semibold mb-6">Frequently Asked Questions</h3>
      <div className="space-y-4 text-left max-w-2xl mx-auto">
        <div>
          <h4 className="font-bold">Q: What is LinkClick?</h4>
          <p>A: A platform to simplify internet usage for everyone.</p>
        </div>
        <div>
          <h4 className="font-bold">Q: Is it free to use?</h4>
          <p>A: Yes, it's completely free.</p>
        </div>
        <div>
          <h4 className="font-bold">Q: How do I get started?</h4>
          <p>A: Just sign up and follow the audio instructions.</p>
        </div>
      </div>
    </section>
  );
};

export default FAQ;
